import React, {Component} from 'react';
import PropTypes from 'prop-types';
import { withStyles } from '@material-ui/core/styles';
import Table from '@material-ui/core/Table';
import TableBody from '@material-ui/core/TableBody';
import TableCell from '@material-ui/core/TableCell';
import TableHead from '@material-ui/core/TableHead';
import TableRow from '@material-ui/core/TableRow';
import Paper from '@material-ui/core/Paper';
import Button from '@material-ui/core/Button';

const styles = theme => ({
  root: {
    display: 'flex',
    marginTop: theme.spacing.unit * 3,
    overflowX: 'hide',
  },
  table: {
    minWidth: 340,
  },
  tableCell: {
    paddingRight: 4,
    paddingLeft: 5
  }
});

let id = 0;
function createData(name, calories, fat, carbs, protein) {
  id += 1;
  return { id, name, calories, fat, carbs, protein };
}



class TimeTable extends Component {
    generateTable = () => {
        this.props.onGenerateTable();
    }


    
    render(){    
        return (
            <React.Fragment style={{marginTop: 200}}>
            <Button style={{marginTop: 50}} color="primary" onClick={this.generateTable}>Generate Table</Button>
            <Paper className={styles.root}>
            <Table className={styles.table}>
                <TableHead>
                <TableRow>
                    <TableCell className={styles.tableCell}>Days</TableCell>
                    <TableCell numeric className={styles.tableCell}>Calories</TableCell>
                    <TableCell numeric className={styles.tableCell}>Fat (g)</TableCell>
                    <TableCell numeric className={styles.tableCell}>Carbs (g)</TableCell>
                    <TableCell numeric className={styles.tableCell}>Protein (g)</TableCell>
                    <TableCell numeric className={styles.tableCell}>Protein (g)</TableCell>
                    <TableCell numeric className={styles.tableCell}>Protein (g)</TableCell>
                    <TableCell numeric className={styles.tableCell}>Protein (g)</TableCell>
                    <TableCell numeric className={styles.tableCell}>Protein (g)</TableCell>
                </TableRow>
                </TableHead>
                <TableBody>
        
                    <TableRow>
                        <TableCell component="th" scope="row" className={styles.TableCell}>hi</TableCell>
                        <TableCell numeric className={styles.tableCell}>hi</TableCell>
                        <TableCell numeric className={styles.tableCell}>hi</TableCell>
                        <TableCell numeric className={styles.tableCell}>hi</TableCell>
                        <TableCell numeric className={styles.tableCell}>hi</TableCell>
                        <TableCell numeric className={styles.tableCell}>hi</TableCell>
                        <TableCell numeric className={styles.tableCell}>hi</TableCell>
                        <TableCell numeric className={styles.tableCell}>hi</TableCell>
                        <TableCell numeric className={styles.tableCell}>hi</TableCell>
                    </TableRow>

                </TableBody>
            </Table>
            </Paper>
            </React.Fragment>
        );
    }
}

export default TimeTable;
